Verenigde Staten / Duitsland
Horror / Sciencefiction
117 minuten

geregisseerd door Paul W.S. Anderson
met Milla Jovovich, Michelle Rodriguez en Kevin Durand

Het dodelijke T-Virus van de Umbrella Corporatie blijft de aarde teisteren en transformeert de wereldbevolking in vleesetende zombies. De laatste hoop voor het menselijk ras is Alice (Milla Jovovich). Zonder veilige plek blijft Alice jagen op de verantwoordelijke van de uitbraak, wat haar in Tokio, New York, Washington en Moskou brengt. Samen met een groep geallieerde en vertrouwde vrienden moet ze zich een weg uit de vijandelijke wereld zien te vechten.



